import Card1 from "../../Displays/Card";
export default function List({ contacts }) {
  console.log(contacts)

  return (
    <div>
      <ul>
        {contacts.map((contact) => (
         
          <li key={contact.id}>
            Name:
            <span>{contact.full_name}</span>
            Phone:
            <span>{contact.tel}</span>
          </li>
          
        ))}
      </ul>
    </div>
  );
}
